 const onSaveExpenseDataHandler = (enteredExpenseData) => {
      const expenseData = {
        id:Math.random().toString(),
           ...enteredExpenseData
          
      }
      props.onAddExpense(expenseData);


          const StartEidtingHandler=() =>{
            setIsEditing(true);
          }
          const StopEidtingHandler=() =>{
            setIsEditing(false);
          }
    }
return (
<div className="new-expense">
   {!isEidting && (
    <button onClick={StartEidtingHandler}>
      Add New Expense</button>)}
     {isEidting && (<NewEXpenseForm onSaveExpenseData={onSaveExpenseDataHandler} onCancle={StopEidtingHandler}/>)}
</div>);
}
